class Seat{
    constructor(number, isOccupied)
    {
        this.number = number;
        this.isOccupied = isOccupied;
    }

    occupy(traveler)
    {
        this.traveler = traveler;
        this.isOccupied = true;
    }

    free()
    {
        this.name = "";
        this.isOccupied = false;
    }
}

export default Seat;
